import React from "react";
import icon1 from "../image/qa/icon1.svg";
import icon2 from "../image/qa/icon2.svg";

export const QaData = [
    {
        title: 'Как загрузить смету?',
        icon: icon1,
        cName: 'qa__block'
    },
    {
        title: 'Как изменить поля таблицы?',
        icon: icon2,
        cName: 'qa__block'
    },
    {
        title: 'Как изменить поля СН и ТСН?',
        icon: icon2,
        cName: 'qa__block'
    },
    {
        title: 'Как изменить поля СН и ТСН?',
        icon: icon2,
        cName: 'qa__block'
    }
]
